import React from "react";
import TextField from "./textField";
import { useState } from "react";

const AddPost = () => {
  const [post, setPost] = useState({ id: "", title: "", text: "" });
  return (
    <>
      <h1>add post</h1>
      <div className="m-4 shadow">
        <TextField
          type="text"
          label="Название поста"
          name="postTitle"
          value={post.title}
        />
      </div>
      <fieldset>
        <div>
          <label>
            Post title: <input name="postTitle" defaultValue="Biking" />
          </label>
        </div>

        <div>
          <label htmlFor="postTextArea">Напишите текст поста</label>
          <textArea id="postTextArea" rows={4} cols={30} />
        </div>
      </fieldset>
    </>
  );
};

export default AddPost;
